// SPDX-License-Identifier: MIT
pragma solidity ^0.8.8;

import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Burnable.sol";
import "@openzeppelin/contracts/access/AccessControlEnumerable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

contract MarketingNFT is
    AccessControlEnumerable,
    ERC721Burnable,
    ERC721Enumerable
{
    using Counters for Counters.Counter;

    string private constant _NAME = "TODO: name the NFT";
    string private constant _SYMBOL = "TODO: give it a symbol";

    bytes32 public constant MANAGER_ROLE = keccak256("MANAGER_ROLE");
    bytes32 public constant MINTER_ROLE = keccak256("MINTER_ROLE");

    struct NFTInfo {
        uint256 categoryId;
    }

    string private __baseURI;
    Counters.Counter private _idCounter;
    mapping(uint256 => NFTInfo) public infoOf;

    constructor(
        string memory name,
        string memory symbol,
        string memory baseURI
    ) ERC721(name, symbol) {
        __baseURI = baseURI;

        _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _setupRole(MANAGER_ROLE, msg.sender);
        _setupRole(MINTER_ROLE, msg.sender);
    }

    function _baseURI() internal view override returns (string memory) {
        return __baseURI;
    }

    function setBaseURI(string calldata value) external onlyRole(MANAGER_ROLE) {
        __baseURI = value;
    }

    function supportsInterface(bytes4 interfaceId) public view
        override(AccessControlEnumerable, ERC721, ERC721Enumerable)
        returns (bool)
    {
        return super.supportsInterface(interfaceId);
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 tokenId
    ) internal override(ERC721, ERC721Enumerable) virtual {
        super._beforeTokenTransfer(from, to, tokenId);
    }

    function mint(address to, NFTInfo calldata info) external onlyRole(MINTER_ROLE) returns (uint256 nftId) {
        _idCounter.increment();
        nftId = _idCounter.current();
        infoOf[nftId] = info;

        _mint(to, nftId);
    }
}
